eureka:
    client:
        serviceUrl:
            defaultZone: '{cipher}'
redis:
    cluster:
        nodes: '{cipher}'
        retry:
            max:
                num: 1000
        time:
            out: 10000
    connect:
        timeout: 15000
    max:
        active: 500
        idle: 100
        wait: 10
    single:
        node:
            ip: '{cipher}'
            port: 33334
server:
    port: 19801
spring:
    datasource:
        driver-class-name: com.mysql.jdbc.Driver
        password: '{cipher}'
        testWhileIdle: true
        url: '{cipher}'
        username: '{cipher}'
        validationQuery: SELECT 1
    batch:
        job:
            enabled: false
    jpa:
        properties:
            hibernate:
                format_sql: true
        show-sql: true            
emar:
    file:
        directory: upload
    cross:
        origin: http://localhost:8080
log4j:
    logger:
        org:
            hibernate:
                type: trace        
